function searchPerformed(e)
{
	
    if (e.changed && e.changed.component.key === 'dlPrograms' && e.changed.value) {
        console.log(e);

        if (IsJsonString(e.data.dlPrograms)) {

            //console.log(e);
            //var test = "{"dlPrograms":"homeCare","form\':\'../forms/insure/v1\'}";
            formioForm.submission={"data":JSON.parse(e.data.dlPrograms)}
            //formioForm.submission = formioForm.submission;	

            /* Fill coverages to default values */
            formioForm.submission.data['dlPrograms'] = "";
            formioForm.getComponent("dlPrograms").component.data.values = [];
            
            FillInitialValues(programID);

            formioForm.getComponent('dlPrograms').triggerUpdate();
        }
    }
}

function changeInsuranceProgram(e) 
{
    if (e.changed && e.changed.component.key === 'columnsInsuranceprogram' && e.changed.value) 
    {
        console.log(e);
        
        if(formioForm.submission.data.columnsInsuranceprogram === 'program1' && programID != "1") 
        {
            TogFormViewer.FormioPlugIn.setProperty('form', 'cover-insure/v1');
            programID = "1";
        }
        else if(formioForm.submission.data.columnsInsuranceprogram === 'program2' && programID != "2") 
        {
            TogFormViewer.FormioPlugIn.setProperty('form', 'cover-insureP2/v1');
            programID = "2";
        }
        else if(formioForm.submission.data.columnsInsuranceprogram === 'program12' && programID != "1.2") 
        {
            TogFormViewer.FormioPlugIn.setProperty('form', 'cover-insureP1.2/v1');
            programID = "1.2";
        }
        else if(formioForm.submission.data.columnsInsuranceprogram === 'program5' && programID != "5") 
        {
            TogFormViewer.FormioPlugIn.setProperty('form', 'cover-insureP5/v1');
            programID = "5";
        }
        else if(formioForm.submission.data.columnsInsuranceprogram === 'program6' && programID != "6") 
        {
            TogFormViewer.FormioPlugIn.setProperty('form', 'cover-insureP6/v1');
            programID = "6";
        }
        
        formioForm.submission.data['dlPrograms'] = {};
        formioForm.getComponent("dlPrograms").component.data.values = [];
        
        FillInitialValues(programID);
        
        formioForm.getComponent('dlPrograms').triggerUpdate();
    }   
}


function fillTable()
{
    var content = "<table border='1px solid blue' cellpadding='3!important'><tr><td><b>Название</b></td><td><b>Станция метро</b></td><td><b>Адрес</b></td><td><b>Город</b></td><td><b>Режим работы</b></td><td><b>Телефон</b></td><td><b>Электронная  почта</b></td><td><b>Вебсайт / сайт</b></td></tr>";
    for(i=0; i<clinicsList.length; i++){
        content += '<tr>';
        content += '<td>' + clinicsList[i]['name'] + '</td>';
        content += '<td>' + clinicsList[i]['metroSt'] + '</td>';
        content += '<td>' + clinicsList[i]['addr'] + '</td>';
        content += '<td>' + clinicsList[i]['city'] + '</td>';
        content += '<td>' + clinicsList[i]['workHours'] + '</td>';
        content += '<td>' + clinicsList[i]['telephone'] + '</td>';
        content += '<td>' + clinicsList[i]['email'] + '</td>';
        content += '<td>' + clinicsList[i]['webSite'] + '</td>';
        content += '</tr>';
    }
    content += "</table>"

    $('#listOfClinics').append(content);
        
}

$('input[name=\'data[searchField]\']').on("keyup", function() {
    var value = $(this).val();
    $("table tr").each(function(index) {
        if (index !== 0) {

            $row = $(this);

            var id = $row.find("td:first").text();
            id = id.toLowerCase();
            value = value.toLowerCase();
            if (id.indexOf(value) === -1) {
                $row.hide();
            }
            else {
                $row.show();
            }
        }
    });
});